import React, { useContext } from 'react';
import authService, {AuthContext} from "../services/auth"; 
import { GiExitDoor } from 'react-icons/gi';
import bus from '../img/bus.png';



function Nav(props) {
    const hidden = () =>{
        const menu = document.querySelector('#navbarSupportedContent');
        menu.classList.toggle('collapse')
    }
    const authData = useContext(AuthContext);

    const handleLogout = () => {
        authService
            .logout()
            .then(rta => {
                if(rta) {
                    authData.updateAuthData({
                        id: null,
                        rol: null,
                        name: null,
                        email: null,
                    });
                    if(typeof props.notExitosa === "function") {
                        props.notExitosa({
                            ...rta.data
                        });
                    }
                }
            })
            .catch(e => console.log('Error: ', e));
    };

    return (<><div>

    <div className="d-flex justify-content-center mt-4" >
         <img
        width="270" height="130" 
        src={bus}
        alt="First slide"
        />
    </div>
    </div>
    
    <nav 
    className="navbar navbar-expand-lg navbar-light bg-warning">

        <a className="navbar-brand" href="#">Andiamo</a>
        <button className="navbar-toggler" 
        type="button" 
        data-toggle="collapse" 
        data-target="#navbarSupportedContent"
        aria-controls="navbarSupportedContent"
        aria-expanded="false" 
        aria-label="Toggle navigation"
        onClick={hidden}>
            
            <span className="navbar-toggler-icon"></span>
        </button>
        
        <div className="collapse navbar-collapse hamburguesa navs" id="navbarSupportedContent" >
            <ul className="navbar-nav mr-auto navegador ">
                <li className="nav-item">
                    <a className="nav-link letras" activeClassName="active" href="/" exact>Home</a>
                </li>

                {
                     authData.user.rol == 2  || authData.user.rol == 1 ? 
                        (<>
                           <li className="nav-item">
                                <a className="nav-link letras" activeClassName="active" href="/viajes">Panel de viajes</a>
                            </li>
                        </>) :
                         (<>
                          
                        </>)
                      
                }

               <li className="nav-item">
                    <a className="nav-link letras" activeClassName="active" href="/viajesusuarios">Viajes</a>
                </li>

                {
                    authData.user.rol == 1 ? 
                        (<>
                           <li className="nav-item">
                                <a className="nav-link letras" activeClassName="active" href="/empresas">Panel de empresas</a>
                            </li>
                        </>) :
                         (<>
                          
                        </>)
                      
                }

                <li className="nav-item">
                    <a className="nav-link letras" activeClassName="active" href="/empresasusuarios"> Empresas</a>
                </li>

                {
                    authData.user.rol == 3 ? 
                        (<>
                <li className="nav-item">
                    <a className="nav-link letras" activeClassName="active" href="/perfil"> Perfil</a>
                </li>
                </>) :
                         (<>
                          
                        </>)
                      
                }

{
                    authData.user.rol == 2 ? 
                        (<>
                <li className="nav-item">
                    <a className="nav-link letras" activeClassName="active" href="/perfilempresa"> Perfil empresa</a>
                </li>
                
                </>) :
                         (<>
                          
                        </>)
                      
                }
                
                <li className="nav-item">
                    <a className="nav-link letras" activeClassName="active" href="/blog">Datos útiles</a>
                </li>
              
                {
                    authData.user.id === null ?
                        (<>
                            <li className="nav-item">
                                <a className="nav-link letras" activeClassName="active" href="/iniciar-sesion">Iniciar Sesión</a>
                            </li>
                        </>) :
                        
                        (<>
                            <li className="nav-item">
                                <button
                                    type="button"
                                    className="btn btn-link nav-link letras"
                                    onClick={handleLogout}
                                >{authData.user.email}<GiExitDoor size={30}/></button>
                            </li>
                        </>)
                }
              
                
            </ul>
        </div>
    </nav></>);
}

export default Nav;
